import logo from './logo.svg';
import './App.css';
import {Listing} from "nasrallah-listing"
import { useState } from 'react';

function App() {

  const [items , setItems] = useState()

  return (
    <div className="App">
      <Listing items={items}></Listing>
    </div>
  );
}

export default App;
